import { Navigate } from "react-router-dom";
import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";

function Tests() {
  const [tests, setTests] = useState();
  const [canRender, setRender] = useState(false);
  const loggedIn = useSelector((state) => state.login);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch("https://dummyjson.com/products");
      if (!response.ok) {
        console.error("Error fetching data");
      } else {
        const data = await response.json();
        setTests(data);
        setRender(true);
      }
    } catch (error) {
      console.error(error);
    }
  };

  const handleCardClick = (test) => {
    // Handle card click event and navigate to the appropriate page with the test data
    // You will need to define the appropriate route and component to handle the page
    <Navigate to={{
      pathname: '/testsolver',
      state: test
    }} />;
  };

  if (loggedIn === "TEACHER") return <Navigate to="/" />;
  if (!canRender) return <>Zəhmət Olmasa Gözləyin</>;
  return (
    <div>
      {tests.map((test, index) => (
        <button key={index} className="card-button" onClick={() => handleCardClick(test)}>
          <h3>{test.TESTNAME}</h3>
          <p>{test.CLASS}</p>
        </button>
      ))}
    </div>
  );
}

export default Tests;
